INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES (1070501, 1, 5, 0, 11, "", "しかし一時には\n赤子同然だった貴方が\nここまで成長したこと……\nとても喜ばしく思います。", 1070501043, 1, 107011, 0);
INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES (1070501, "", "", "", 91, "", "", 1070501044, "", 0, "");
